webpackJsonp([0xca2a12e72487],{637:function(e,a){e.exports={data:{markdownRemark:{html:'<h3>Human Augmented Signal</h3>\n<p>We enable programs to utilize the expertise of HackerOne Security Analysts to review those pesky invalid reports so that programs donâ€™t have to deal with them. Learn more about <a href="/programs/human-augmented-signal.html">Human Augmented Signal</a>. </p>\n<h3>Response SLAs</h3>\n<p>You can now set your response service level agreements (SLAs) for time to first response, time to triage, time to bounty, and time to resolution. What do all these terms mean? Find out <a href="/programs/response-target-metrics.html">here</a>.</p>\n<h3>Response Efficiency Indicator</h3>\n<p>We now display a colored indicator on a program\'s security page to show hackers how responsive a program is to report submissions.  </p>\n<h3>SLA Inbox Labels</h3>\n<p>If you forget which reports aren\'t meeting your response SLAs, we now have <i>SLA Miss</i> and <i>SLA Fail</i> labels as well as a new SLA Violations view in your inbox to show which reports need action.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/jan_2018-1d728b5c06e9575c2b8ded21d3f4be4c-e700e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 67.38056013179572%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="jan_2018"\n        title=""\n        src="/static/jan_2018-1d728b5c06e9575c2b8ded21d3f4be4c-2f183.png"\n        srcset="/static/jan_2018-1d728b5c06e9575c2b8ded21d3f4be4c-67829.png 125w,\n/static/jan_2018-1d728b5c06e9575c2b8ded21d3f4be4c-5c59f.png 250w,\n/static/jan_2018-1d728b5c06e9575c2b8ded21d3f4be4c-2f183.png 500w,\n/static/jan_2018-1d728b5c06e9575c2b8ded21d3f4be4c-c93e8.png 750w,\n/static/jan_2018-1d728b5c06e9575c2b8ded21d3f4be4c-4e628.png 1000w,\n/static/jan_2018-1d728b5c06e9575c2b8ded21d3f4be4c-e700e.png 1214w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Pausing Report Submissions</h3>\n<p>Want to take a break or need time to catch up on existing reports? Programs can now pause from accepting new report submissions.</p>',frontmatter:{path:"/changelog/2018/january",title:"January 2018"}}},pathContext:{}}}});
